void moveright(double steps){//pos x direction
    //RD4 = 0;
    //RD6 = 0;
    PORTD = 0x00;
    for(int i = 0; i < steps; i++){
        PORTD |= 0x50;
        __delay_ms(2/(2.0*4));
        PORTD &= ~0x50;
        __delay_ms(1/(2.0*4));
    }
    return;
}

void moveleft(double steps){//negative x direction
    PORTD = 0xA0;
    for(int i = 0; i < steps; i++){
        PORTD |= 0x50;
        __delay_ms(2/(2.0*4));
        PORTD &= ~0x50;
        __delay_ms(1/(2.0*4));
    }
    return;
}

void movedown(double steps){
    PORTD = 0x20;
    for(int i = 0; i < steps; i++){
        PORTD |= 0x50;
        __delay_ms(2/(2.0*4));
        PORTD &= ~0x50;
        __delay_ms(1/(2.0*4));
    }
    return;
}

void moveup(double steps){
    PORTD = 0x80;
    for(int i = 0; i < steps; i++){
        PORTD |= 0x50;
        __delay_ms(2/(2.0*4));
        PORTD &= ~0x50;
        __delay_ms(1/(2.0*4));
    }
    return;
}

void returntoorigin(){
    if(currposy > 0){
        moveup(mmaxisconversion(currposy));
    }
    if(currposx > 0){
        moveleft(mmaxisconversion(currposx));
    }
}

void movetoPositionFF(double inpx, double inpy){
    double holdx, holdy = 0;
    holdx = inpx - currposx;
    holdy = inpy - currposy;
    double mminputang = 0;
    if(holdx > holdy && holdy > 0){//x is further and y moves up
        
        mminputang = holdx*holdx + holdy*holdy;
        mminputang = sqrt(mminputang);
        movedownright(mmangledconversion(mminputang));
    }
    else if(holdx > holdy && holdy < 0){//samve as above only y moves down
        mminputang = holdx*holdx + holdy*holdy;
        mminputang = sqrt(mminputang);
        moveupleft(mmangledconversion(mminputang));
    }
    else if(holdy > holdx && holdx > 0){//y is further and x moves right
        mminputang = holdx*holdx + holdy*holdy;
        mminputang = sqrt(mminputang);
        movedownleft(mmangledconversion(mminputang));
    }
    else if(holdy > holdx && holdx < 0){//same as above only x moves left
        mminputang = holdx*holdx + holdy*holdy;
        mminputang = sqrt(mminputang);
        moveupright(mmangledconversion(mminputang));
    }
    return;
}

